import React, { useEffect } from 'react';
import { useLocation, useHistory } from 'react-router-dom';

const AuthCallback = () => {
  const location = useLocation();
  const history = useHistory();

  useEffect(() => {
    // Extract provider from query string
    const searchParams = new URLSearchParams(location.search);
    const provider = searchParams.get('provider');

    switch (provider) {
      case 'naver':
        handleNaverLogin();
        break;
      case 'kakao':
        handleKakaoLogin();
        break;
      // Handle other providers as needed
      default:
        // Redirect to login or error page if provider is not recognized
        history.push('/login');
    }
  }, [location, history]);

  const handleNaverLogin = () => {
    // Process Naver login, e.g., extract token, verify, set in local storage or context
    console.log('Handling Naver login');
    // Redirect to dashboard or other internal route
    history.push('/dashboard');
  };

  const handleKakaoLogin = () => {
    // Process Kakao login similarly
    console.log('Handling Kakao login');
    history.push('/dashboard');
  };

  return (
    <div>Processing login information...</div>
  );
};

export default AuthCallback;
